import styled from 'styled-components';

const IndexImageStyles = styled.div`
  #hoodies {
    background-image: url(/hoodies.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    position: absolute;
    height: 100%;
    width: 100%;
    background-position: center;
  }

  #dresses {
    background-image: url(/dresses.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    position: absolute;
    height: 100%;
    width: 100%;
    background-position: center;
  }

  #footwear {
    background-image: url(/footwear.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    position: absolute;
    height: 100%;
    width: 100%;
    background-position: center;
  }

  #shirts {
    background-image: url(/shirts.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    position: absolute;
    height: 100%;
    width: 100%;
    background-position: center;
  }

  #shirts {
    background-image: url(/shirts.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    position: absolute;
    height: 100%;
    width: 100%;
    background-position: center;
  }

  #kids {
    background-image: url(/kids.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    position: absolute;
    height: 100%;
    width: 100%;
    background-position: center;
  }

  #accessories {
    background-image: url(/accessories.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    position: absolute;
    height: 100%;
    width: 100%;
    background-position: center;
  }

  #accessories {
    background-image: url(/female.jpg);
    background-size: cover;
    background-repeat: no-repeat;
    position: absolute;
    height: 100%;
    width: 100%;
    background-position: center;
  }

  h1 {
    text-align: center;
    color: rgb(230, 250, 250);
    text-transform: uppercase;
    font-family: Arial, Helvetica, sans-serif;
    font-size: 120px;
    background-color: rgba(0, 0, 15, 0.3);
    font-style: italic;
    margin-top: 12%;
  }
`;

export default IndexImageStyles;
